import { WithHttp } from '../novu.interface';
export class Feeds extends WithHttp {
    async create(name) {
        return await this.http.post(`/feeds`, { name });
    }
    async get() {
        return await this.http.get(`/feeds`);
    }
    async delete(feedId) {
        return await this.http.delete(`/feeds/${feedId}`);
    }
}
